import React from 'react';

const NavStyle = {
  display: 'inline'
}

const Opacity = {
  background: 'none'
}

const Text = {
  color: '#fff'
}

class Nav extends React.Component{
  render(){
    return(
      <header className="sticky-top" style={NavStyle}>
        <nav className="navbar navbar-expand-lg" style={Opacity}>
          <a className="navbar-brand" href="#home">Internal Medicine</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarContent">
            <span className="navbar-toggler-icon" ></span>
          </button>
          <div className="collapse navbar-collapse float-right" id="navbarContent">
            <ul className="navbar-nav ml-auto">
              <li className="nav-item" style={Text}>
                <a className="nav-link" href="#home" style={Text}>Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#form">Forms</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#contact">Contact Us</a>
              </li>
            </ul>
          </div>
        </nav>
      </header>
    );
  }
}

export default Nav;
